import { useEffect, useState } from "react"

const UserInfo = ({ setInfoModel, userData }) => {

    const handleClick = () => {
        setInfoModel(false)
    }


    let data = Array.from(userData.project);

    const list = (project) => {

        return (project.map((project) =>

            <div>
                <h4>Project Title: {project.protitle} </h4>
                <h4>Project Des: {project.prodes}</h4>
            </div>)

        )
    }

    console.log("linkk", userData)

    return (
        <div className="userInfo-model">
            <div className="close-icon" onClick={handleClick}>âœ–</div>

            <div className="userInfo-content"><h2><b><u>User Information</u></b></h2>
                <div> </div>

                <div><h3>University: {userData.university}</h3></div>
                <div><h3>Github Link: <a href={userData.githublink}>Link</a></h3></div>
                <div><h3>LinkedIn Link: <a href={userData.linkedinlink}>Link</a></h3></div>
                <div><h3>Year of Experience: {userData.YOE}</h3></div>
                <div><h3>Bio: {userData.bio}</h3></div>
                <div><h3>{list(data)}</h3></div>
            </div>

        </div>
    )
}

export default UserInfo
